script: |
  super -f text -I q380.spq | sort > q380.out

inputs:
  - name: q380.spq
    data: |
      SELECT + col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 93 * + 54 + + col1 * - 58 + 80 * - 9 IS NULL OR NOT NULL <> col0;
  - name: tab2

outputs:
  - name: q380.out
    data: |
      23
      40
      58
